import React , { Component} from 'react'

class LogTrack extends Component {

    render() {
        return(
            <div>
                <h1> TRACKING LOG </h1>
                <textarea rows='30' cols='120'> e.g STATUS: NORMAL </textarea>
            </div>
        );
    }
}

export default LogTrack
